import { Box, Typography } from "@mui/material";

const NotFound = () => {
  return (
    <Box
      sx={{
        backgroundColor: "#fff",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        width: { sm: "280px", lg: "300px" },
      }}
    >
      <Typography>404 - Not Found!</Typography>
    </Box>
  );
};

export default NotFound;
